import React from "react";
import './gallery.css';
import Image from '../../assets/images.jpg'
import { gData } from '../gallery/galArray.js'


const Gallery = () => {
    return (
        

<div>
    {
        gData.map((i) => <img src={i.src} alt="gallery"/>)
    }
        
    </div>
  

    )
}
export default Gallery
